function createContent(id,doc,position){
    
    
    try{ 
       if(isNaN(doc.autoTable.previous.finalY)){
           pos=position;
       }else{
           pos=doc.autoTable.previous.finalY + position;
       }
    }catch (exception){
        pos=0;
    }
    
     try{ 
    var specialElementHandlers = {
            '#editor': function(element, renderer){
                    return false;
            }
    };
    
    doc.fromHTML($('#'+id).get(0) // HTML string or DOM elem ref.
    , margins.left // x coord
    , pos // y coord
    , {
         background: '#fff',
         lineWidth: 0,
            //'width': margins.width, // max width of content on PDF
         'elementHandlers': specialElementHandlers
    },function (dispose) {
        //doc.addPage();
    },margins);
   
     }catch (exception){
       console.log(exception)
    }
}


function generateTable(id,doc,position) {
   var pos=0;
    try{ 
       if(isNaN(doc.autoTable.previous.finalY)){
           pos=position;
       }else{
           pos=doc.autoTable.previous.finalY + position;
       }
    }catch (exception){
        pos=0;
    }
   
  var res = doc.autoTableHtmlToJson(id);
 
  var options1 = {
    theme:'plain',
    margin: {
      top: 80,
    },
    styles: { // Defaul style
      
           cellPadding: 5, // a number, array or object (see margin below)
            fontSize: 10,
            font: "helvetica", // helvetica, times, courier
            lineColor: 200,
        lineWidth: 0,
        fontStyle: 'normal', // normal, bold, italic, bolditalic
        overflow: 'ellipsize', // visible, hidden, ellipsize or linebreak
        fillColor: false, // false for transparent or a color as described below
        textColor: 20,
        halign: 'left', // left, center, right
        valign: 'middle', // top, middle, bottom
        columnWidth: 'auto' // 'auto', 'wrap' or a number
            },
        columnStyles: {titulo: {columnWidth: 'auto'},entidad: {columnWidth: 'auto'}},    
        startY: pos
      };
 
  doc.autoTable(res.columns, res.data, options1);
 
}


function tableToJson(table, columns,tipo) {
    try{
        var data = [];
        // go through cells
        if(tipo==1){
            for (var i = 1; i < table.rows.length; i++) {
                  var tableRow = table.rows[i];
                  data.push({
                        tn: tableRow.cells[1].innerHTML,
                        nro: tableRow.cells[2].innerHTML,
                        fecha: tableRow.cells[3].innerHTML,
                        titulo: tableRow.cells[4].innerHTML,
                        cobertura: tableRow.cells[5].innerHTML,
                        entidad: tableRow.cells[6].innerHTML
                    });
            }
        }else{
            for (var i = 1; i < table.rows.length; i++) {
                  var tableRow = table.rows[i];
                  data.push({
                        cd: tableRow.cells[0].innerHTML,
                        act: tableRow.cells[1].innerHTML,
                        desc: tableRow.cells[2].innerHTML
                    });
            }  
        }
    }catch (exception) {
        console.error(exception)
        throw new exception;
    }


        return data;
}



